import React from 'react';
import { useState, useEffect } from 'react';
import '../../src/App.css';
export const Feed = () => {
    const [state, setState] = useState(1);
    
    function increase(){
        state = state+1;
        setState(state);

    }
    return (
        <div className='feed'>
        <h2 >{state}</h2>
        <button className='button' onClick={increase}>+</button>
        </div>
    );
}
export default Feed;
